import React, { Component } from 'react';
import './Header.css';

const rdbAlertLogo = require('../../Assets/Assets/logo.png');

class Header extends Component {
  render() {
    return (
      <header>
        <div className="logo">
          <img src={rdbAlertLogo} alt="rdbAlert-logo" />
          <h5>RDBAlert</h5>
        </div>
      </header>
    );
  }
}
export default Header;
